-- Add Maharashtra region in geofencing config, for 'NAMMA_YATRI_PARTNER' merchant.
UPDATE atlas_driver_offer_bpp.merchant
SET
  origin_restriction = ARRAY_APPEND(origin_restriction, 'Maharashtra'),
  destination_restriction = ARRAY_APPEND(destination_restriction, 'Maharashtra')
WHERE short_id = 'NAMMA_YATRI_PARTNER';

